My newest painting, Wild Bloom, is a part of the Jardin de Rosas group show opening at @opengallerylb tonight!

I chose to paint wild roses in some bright, bold colors that wrap around the sides of the panel. My first painting in my new studio space here in Las Vegas, and it was a fun one!

Thanks to @stevemartinezart  for including me in this phenomenal line-up of artists. 

Painting is 12 x 12, available for purchase through @opengallerylb 

